INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 100, "", 40000, 36, 0, 0, 0, "", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (1, 150, "ぺコリーヌ", 40001, 37, 107501, 1, 0, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 150, "コッコロ", 40001, 38, 107601, 1, 0, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (3, 150, "キャル", 40001, 39, 107801, 1, 0, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (4, 150, "スズメ", 40001, 40, 107701, 1, 0, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (5, 150, "タマキ", 40001, 41, 107901, 1, 0, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (6, 150, "ぺコリーヌ", 40001, 42, 107501, 2, 0, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (7, 150, "コッコロ", 40001, 43, 107601, 2, 0, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (8, 150, "キャル", 40001, 44, 107801, 2, 0, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (9, 150, "スズメ", 40001, 45, 107701, 2, 0, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 91002, 8);
INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (10, 150, "タマキ", 40001, 46, 107901, 2, 0, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 91002, 8);
