INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (2, 1, "クリア", 40011, 322, 126001, 1, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 2);
