INSERT INTO `v1_d757abd2f161ce56e05db517625170d01bf1f1f3a262c7d1a3c69be5dab1ee12` VALUES (5, 1, "クリア", 40011, 325, 126001, 2, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 2);
